<script setup>
import { computed } from "vue";

const props = defineProps({
  eidolon: {
    type: Object,
    required: true,
  },
});
const starImages = [
  "",
  "",
  "",
  "",
];
const starLevel = computed(() => {
  let starLevel = 0;
  props.eidolon.materials.forEach((material, index) => {
    if (material.items.every((item) => item.selected)) {
      starLevel = index + 1;
    }
  });
  return starLevel;
});
</script>
<template>
  <div class="eidolon-star">
    <div style="min-width: 70px; text-align: center">
      <img
        :src="`data:image/png;base64,${starImages[starLevel]}`"
        :alt="`${starLevel + 1} star(s)`"
        style="
          vertical-align: middle;
          width: 50px;
          height: 50px;
          margin-top: 4px;
        "
      />
    </div>
  </div>
</template>
